import { useSelector } from 'react-redux';

export default function OneDish() {
    const restaurants = useSelector((state:any) => state.restmoreinfo.value);
  return (
    <div>
        {restaurants.map((a:any)=>(
            <div>
                {a}
                </div>
        ) )}
    </div>
  )
}
